import { allUsersAction, allUsersState } from "../../types/allUsersTypes";


export const usersState = [];


export function allUsersReducer(state:allUsersState,action:allUsersAction) {
    switch (action.type) {
        case "Get_All_Users": {
            return [
                ...state,
                action.allUsers
            ]
        }
    }
}
